      new_pos = { x: -(this.canvas.x * new_zoom) + margin + (size.width - margin * 2 - this.canvas.width * new_zoom) / 2,
        y: -(this.canvas.y * new_zoom) + margin + (size.height - margin * 2 - this.canvas.height * new_zoom) / 2 };
